DROP TABLE IF EXISTS `handle_detail_tab`;
CREATE TABLE `handle_detail_tab` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `file_id` int(20) NOT NULL COMMENT '处理文件表id',
  `file_creater_code` varchar(10) DEFAULT NULL COMMENT '文件创建人代码',
  `file_receiver_code` varchar(10) DEFAULT NULL COMMENT '文件接收人代码',
  `interface_id` varchar(10) DEFAULT NULL COMMENT '接口标识',
  `submission_date` varchar(10) DEFAULT NULL COMMENT '报送日期',
  `file_num` varchar(10) DEFAULT NULL COMMENT '文件序号',
  `operation_id` varchar(2) DEFAULT NULL COMMENT '操作标识',
  `submission_record_id` varchar(50) DEFAULT NULL COMMENT '报送记录号',
  `data_json` longtext COMMENT 'json数据',
  `status` int(2) DEFAULT NULL COMMENT '状态',
  `submission_msg` varchar(2000) DEFAULT NULL COMMENT '报送返回提示信息',
  `submission_error` varchar(2000) DEFAULT NULL COMMENT '报送返回错误信息',
  `submission_bizid` varchar(2000) DEFAULT NULL COMMENT '报送返回报告业务编号',
  `submission_protcolid` varchar(2000) DEFAULT NULL COMMENT '报送返回协议编号',
  `submission_data` varchar(2000) DEFAULT NULL COMMENT '报送返回附加信息',
  `response_msg` varchar(2000) DEFAULT NULL COMMENT '应答信息',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

